// ProductCard의 내부 jsx
function ProductCardList({ item }) { 
    return (
        <div>
            <img src={item.images[0]} alt={item.tags} />
            <div>
                <h3>{item.name}</h3>
                <p>{item.price}</p>
                <div>
                <p>{item.favoriteCount}</p>
                </div>
            </div>
        </div>
    );
} 

function ProductCard({ items }) {
    return (
        <ol>
            {items.map((item) => (
                <li key={item.id}>
                    <ProductCardList item={item}/>
                </li>
            ))}
        </ol>
    );
}

export default ProductCard;
